The contract file for a particular requirement has a number of parent folders and under each parent folder are a number of subfolders. Configure the folder names and folder structure for each newly created requirement in this rule. In addition, configure the textMatch parameter and the docType parameter for each subfolder to allow for intelligent filing of documents.

